import React from 'react';

const ApplyNowButtonCard = ({Height, Width, FontSize, FontWeight, ButtonText}) => {
    return(
        <div style={{height: Height, width: Width, fontSize: FontSize, fontWeight: FontWeight}} className='border border-solid border-gray-300'>
<button
              class="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline"
              type="button"
            >
              {ButtonText}
            </button>

        </div>
    )
}

export default ApplyNowButtonCard;
